import React from "react";

const Cells = (props) => {
  let renderCell = () => {
    if (props.data.clickable === true) {
      let a = false;
      let b = true;
      let aLR = false;
      let bLR = true;
      let c = true;

      if (props.data.lineStaff === true) {
        aLR = true;
        bLR = false;
      }

      if (props.data.note > 0) {
        a = true;
        b = false;
      }

      if (props.data.lineStaff === true) {
        c = false;
      }

      if (props.data.isOpen === false) {
        return (
          <div>
            {b ? (
              <div>
                <div
                  className="cell-enabler"
                  onClick={() => props.click(props.data)}
                >
                  <div className="measure-text">{props.data.measure}</div>
                  {
                    <div>
                      {props.data.selectColumn ? (
                        <div className="selected"></div>
                      ) : null}
                    </div>
                  }
                  {props.data.barline ? <div className="barline"></div> : null}

                  {props.data.lineStaff ? (
                    <div className="staff-line"></div>
                  ) : null}
                </div>
              </div>
            ) : null}

            {a ? (
              <div>
                <div className="cell-enabler-isOpen">
