                      <h2>{props.data.accLocation[5][10].acc}</h2>
                    ) : null}
                  </div>
                </div>
              ) : null}

              {props.data.accLocation[5][11].my ? (
                <div
                  className="measure-cell"
                  onClick={() => {
                    props.data.mx = 6;
                    props.data.my = 10;
                    let mx = 6;
                    let my = 10;
                    props.click(props.data, kind, mx, my);
                  }}
                >
                  <div className="measure-staff-space-ks">
                    {props.data.accLocation[6][0].my ? (
                      <h2>{props.data.accLocation[6][10].acc}</h2>
                    ) : null}
                  </div>
                </div>
              ) : null}
            </div>
          </div>
        </div>
      );
    }
  };
  return renderCell();
};

export default Cells;
